import React from 'react';
import './App.css';
import Form from './Components/Form'; 
import Main from './Components/Main/index';
import Field from './Components/Field';

function App(){
  return (
  <Main>
    <Form >
      <Field.Text label="N° Registro" name="NRegistro" type="Number"/>
      <Field.Text label="Usuário do Cadastro" name="NRegistro" type="Number"/>
      <Field.Text label="Usuario" name="NRegistro" type="Number"/>

    </Form>
  </Main>
  );
}

export default App;
